RecFormat := recformat<label,level,genus,rank,num_known_degree1_points,generators,subgroup>;


function create_record(row)
    out := rec<RecFormat|label:=row[1],level:=row[2],genus:=row[3],rank:=row[4],num_known_degree1_points:=row[5],generators:=row[6]>;
    subgroup := out`level eq 1 select sub<GL(2,Integers())|> else sub<GL(2,Integers(out`level))|out`generators>;
    out`subgroup := subgroup;
    return out;
end function;

function make_data()
    return [create_record(row) : row in data];
end function;

function generates_unit_group(N, gens)
    A, psi := UnitGroup(Integers(N));
    gens_A := [];
    for g in gens do 
        _, x := HasPreimage(g, psi);
        Append(~gens_A, x);
    end for;
    return #sub<A | gens_A> eq #A;
end function;

function has_surjective_determinant(N, gens)
    return generates_unit_group(N, [Determinant(GL(2,Integers(N))!M) : M in gens]);
end function;

function contains_all_scalars(N, gens)
    G := sub<GL(2, Integers(N)) | gens>;
    A, psi := UnitGroup(Integers(N));
    return &and [GL(2,Integers(N))![psi(x),0,0,psi(x)] in G: x in Generators(A)];
end function;

function process(row)
    return row[2], row[6];
end function;

X := [row : row in data | contains_all_scalars(row[2], row[6]) and has_surjective_determinant(row[2], row[6])];



// Label --
//    The **label** of a modular curve $X_H$ is the same as the label of the open subgroup $H\le \GL_2(\widehat\Z)$. When $\det(H)=\widehat\Z^\times$ and $-I\in H$ this label has the form $\texttt{N.i.g.c.n}$, where

//    - $N$ is the level of $H$
//    - $i$ is the index of $H$
//    - $g$ is the genus of $H$
//    - $c$ is a base-26 ordinal that uniquely identifies the Gassmann class of $H$ among groups of the same level, index, and genus.
//    - $n$ is a positive integer that distinguishes nonconjugate subgroups of the same level, index, genus, and Gassmann class.

//    When $\det(H)=\widehat\Z^\times$ and $-I\not \in H$ this label has the form $\texttt{N.i.g-M.c.m.n}$, where $N$, $i$, and $g$ are as above, and

//    - $N$ is the level of $H$
//    - $i$ is the index of $H$
//    - $g$ is the genus of $H$
//    - $M$ is the level of $H':=\langle H, -I\rangle$
//    - $c$ is the base-26 ordinal that identifies the Gassmann class of $H'$
//    - $m$ is the positive integer in the label $\texttt{M.j.g.c.m}$ of $H'$, where $i=2j$.
//    - $n$ is a positive integer that distinguishes $H$ from nonconjugate refinements of $H'$ of the same level.


// Level --
//    The **level** of a modular curve $X_H$ is the level of the open subgroup $H\leq \GL_2(\widehat\Z)$.


// Genus --
//    By the **genus** of a modular curve $X_H$, we mean the genus of any of its geometric components.   This equals the genus of the open subgroup $H\leq \GL_2(\widehat \Z)$.


// Rank --
//    The **analytic rank** of a modular curve is the order of vanishing of its L-function at its central point, which is equal to the sums of the analytic ranks of the L-functions of the simple modular abelian varieties corresponding to Galois orbits of modular forms that are the isogeny factors of its Jacobian.

//    The Birch and Swinnerton-Dyer conjecture for modular abelian varieties implies that the analytic rank is equal to the Mordell-Weil rank of the Jacobian.


//$j$-points (num_known_degree1_points) --
//    Points on modular curves fall into three categories: cusps, CM points and other points (corresponding to non-CM elliptic curves).  Since we don't always have coordinates for points on a model, we group points by $j$-invariant and count the number of distinct $j$-invariants.  In particular, this means that the number of cusps will always be 1 or 0, depending on whether or not there are any rational cusps, since all cusps lie above $j=\infty$.

//    When searching, you can specify the number of points (of any type), the number of noncuspidal points, or the number of other points (non-cuspidal and non-CM).  In each case, the count is based on the number of points of that type stored in the database, which may be less than the actual number of points on the curve.  In particular, this count is always finite, even for genus 0 curves and positive rank elliptic cuves that have infinitely many rational points.


//$\operatorname{GL}_2(\mathbb{Z}/N\mathbb{Z})$-generators (generators) --
//    Let $H$ be an open subgroup of $\GL_2(\widehat\Z)$ of level $N$, let $\pi_N\colon \GL_2(\widehat\Z)\to \GL_2(\Z/N\Z)$ be the natural projection, and let $E$ be an elliptic curve over a number field $K$.

//    An **$H$-level structure** on $E$ is the $H$-orbit $[\iota]_H:=\{ h\circ \iota\colon h\in \pi_N(H)\}$ of an isomorphism $\iota\colon E[N]\overset{\sim}{\rightarrow}(\Z/N\Z)^2$.

//    An $H$-level structure on $E$ is **rational** if it lies in a $\Gal_K$-stable isomorphism class of pairs $(E,[\iota]_H)$, where $\sigma\in \Gal_K$ acts via $(E,[\iota]_H)\mapsto (E^\sigma,[\iota\circ\sigma^{-1}]_H)$.
//    Two pairs $(E,[\iota]_H)$ and $(E',[\iota']_H)$ are isomorphic if there is an isomorphism $\phi\colon E\to E'$ that induces an isomorphism $\phi_N\colon E[N]\to E'[N]$ for which $\phi_N^*([\iota']_H) = [\iota]_H$.

//    If $E$ admits a rational $H$-level structure $[\iota]_H$ then image of its adelic Galois representation $\rho_E\colon \Gal_K\to \GL_2(\widehat\Z)$ is conjugate to a subgroup of $H$ and the isomorphism class of $(E,[\iota]_H)$ is a non-cuspidal $K$-rational point on the modular curve $X_H$.

//    When $-1\in H$ every non-cuspidal $K$-rational point on $X_H$ arises in this way.  When $-1\not\in H$ this is almost true, but there may be exceptions at points with $j(E)=0,1728$.

//    Invariants of a rational $H$-level structure include:

//    - **Cyclic $\boldsymbol{N}$-isogeny field degree**: the minimal degree of an extension $L/K$ over which the base change $E_L$ admits a rational cyclic isogeny of degree $N$; equivalently, the index of the largest subgroup of $H$ fixing a subgroup of $(\Z/N\Z)^2$ isomorphic to $\Z/N\Z$.
//    - **Cyclic $\boldsymbol{N}$-torsion field degree**: the minimal degree of an extension $L/K$ for which $E_L$ has a rational point of order $N$; equivalently, the index of the largest subgroup of $H$ that fixes a point of order $N$ in $(\Z/N\Z)^2$.
//    - **N-torsion field degree** the minimal degree of an extension $L/K$ for which $E[N]\subseteq E(L)$; this is simply the cardinality of the reduction of $H$ to $\GL_2(\Z/N\Z)$.


